import React from 'react';
import Clock from 'react-digital-clock';

const App = () => {
  return (
    <>
      <div
        style={{
          backgroundColor: 'hsl(206deg 78% 53%)',
          textAlign: 'center',
          padding: '20px',
          fontSize: '20px',
        }}
      >
        <h1>Digital Clock By npm</h1>
        <Clock />
      </div>
    </>
  );
};

export default App;
